{"highlighted_text":"But look, are you sure you’re ok? Did something just happen?”

 

Here it was again, the chance to unburden, but I still didn’t take it.

 

That’s exactly what she wants - something to hold over me"}

{"highlighted_text":"A shape detached itself from the shadows on the landing at the top of the stairs.

 

Please, no.

 

I knew what came next. Of course I did. I had been re-living it for almost twenty years"}
